const mainnetConverter = (mainnetChainId: number | undefined) => {
  switch (mainnetChainId) {
    case 56:
      return "Binance Mainnet"
    case 97:
      return "Binance Testnet"
    default:
      return "Binance Mainnet"
  }
}

export default mainnetConverter;
